import Following from "./pages/Following";
import Home from "./pages/Home";

const publicRoutes = [
    {
        path: '/',
        component: Home,
        layout: He
    },
    {
        path: '/following',
        component: Following, 
        layout: null
    }
]

export {publicRoutes};
